	function emoji_docomo_to_unified(	$text){ return emoji_convert_incoming($text, 3); }
	function emoji_kddi_to_unified(		$text){ return emoji_convert_incoming($text, 7); }
	function emoji_softbank_to_unified(	$text){ return emoji_convert_incoming($text, 11); }
	function emoji_google_to_unified(	$text){ return emoji_convert_incoming($text, 15); }


	#
	# functions to convert unified data into an outgoing format
	#

	function emoji_unified_to_docomo(	$text){ return emoji_convert_outgoing($text, 3, 6); }
	function emoji_unified_to_kddi(		$text){ return emoji_convert_outgoing($text, 7, 10); }
	function emoji_unified_to_softbank(	$text){ return emoji_convert_outgoing($text, 11, 14); }
	function emoji_unified_to_google(	$text){ return emoji_convert_outgoing($text, 15, 0); }


	#
	# function for sexy cross-platform html
	#

	function emoji_unified_to_html(		$text){ return emoji_convert_html($text); }


	function emoji_convert_incoming($text, $index){

		#
		# build the lookup table
		#

		if (!is_array($GLOBALS['emoji_cache']["incoming-$index"])){

			$GLOBALS['emoji_cache']["incoming-$index"] = array();
			foreach ($GLOBALS[emoji_map] as $list){
				if ($list[$index]){
					$GLOBALS['emoji_cache']["incoming-$index"][emoji_utf8_bytes($list[$index])] = emoji_utf8_bytes($list[1]);
				}
			}
		}


		#
		# replace
		#

		return str_replace(array_keys($GLOBALS['emoji_cache']["incoming-$index"]), $GLOBALS['emoji_cache']["incoming-$index"], $text);
	}


	function emoji_convert_outgoing($text, $index, $fallback){

		#
		# build the lookup table
		#

		if (!is_array($GLOBALS['emoji_cache']["outgoing-$index"])){

			$GLOBALS['emoji_cache']["outgoing-$index"] = array();
			foreach ($GLOBALS[emoji_map] as $list){
				if ($list[$index]){
					$GLOBALS['emoji_cache']["outgoing-$index"][emoji_utf8_bytes($list[1])] = emoji_utf8_bytes($list[$index]);
				}else{
					if (strlen($list[$fallback])){
						$GLOBALS['emoji_cache']["outgoing-$index"][emoji_utf8_bytes($list[1])] = $list[fallback];
					}else{
						$GLOBALS['emoji_cache']["outgoing-$index"][emoji_utf8_bytes($list[1])] = '?';
					}
				}
			}
		}


		#
		# replace
		#

		return str_replace(array_keys($GLOBALS['emoji_cache']["outgoing-$index"]), $GLOBALS['emoji_cache']["outgoing-$index"], $text);
	}

	function emoji_convert_html($text){

		#
		# build the lookup table
		#

		if (!is_array($GLOBALS['emoji_cache']["html"])){

			$GLOBALS['emoji_cache']["html"] = array();
			foreach ($GLOBALS[emoji_map] as $list){
				if ($list[1] > 0x80){
					$hex = sprintf('%x', $list[1]);
					$GLOBALS['emoji_cache']["html"][emoji_utf8_bytes($list[1])] = "<span class=\"emoji emoji$hex\"></span>";
				}
			}
		}

		#
		# replace
		#

		return str_replace(array_keys($GLOBALS['emoji_cache']["html"]), $GLOBALS['emoji_cache']["html"], $text);
	}

	function emoji_get_name($unified_cp){

		foreach ($GLOBALS[emoji_map] as $list){
			if ($unified_cp == $list[1]) return $list[2];
		}

		return '?';
	}

	function emoji_utf8_bytes($cp){

		if ($cp < 128){
			return chr($cp);

		}elseif ($cp < 2048){
			return chr(192 + (($cp - ($cp % 64)) / 64))
				.chr(128 + ($cp % 64));

		}else{
			return chr(224 + (($cp - ($cp % 4096)) / 4096))
				.chr(128 + ((($cp % 4096) - ($cp % 64)) / 64))
				.chr(128 + ($cp % 64));
		}
	}

